Majikoi Partial Patch (Yukie/Chris/Momoyo/Kazuko)
Company: Minato Soft
Release date: Apr 21, 2009
Genre: Visual Novel
Language: English subtitled


Partial Patch of Majikoi, released by TakaJun.

Translates the prologue, Christiane route, Momoyo route, Yukie route, Kazuko (Wanko) route, teacher side route, tutorials, end-game skits, staff room, and the going home option in the character select screen. Miyako route is 85% translated.



Translator: TakaJun
Quality Control: DxS
